子猫や子犬、介護が必要なペットなどに<br>
お水や流動食をあげるのに便利！<br>
<br>
○商品サイズ：約 直径25mm×160mm<br><br>
≪品質表示≫<br>
シリンダー　：ポリプロピレン／耐熱温度90度<br>
プランジャー：ポリプロピレン／耐熱温度90度<br>
ガスケット　 ：エラストマー　／耐熱温度70度<br>
<br>
◆水や薬、フードなど対象や用途によって選べる<br>　３サイズ展開のラインナップがあります。<br>
　・Ｓサイズ(10ml)　お水やお薬を与える時に<br>
　・Ｍサイズ(30ml)　お水やフードを与える時に<br>
　・Ｌサイズ (50ml)　フードを与える時に<br>
<br><BR>

